import base64
from models.config import get_assets_path
import os

ico_encoded = r''

assets_path = get_assets_path()

def create_icon():
    ico_bytes = base64.b64decode(ico_encoded)
    ico_path = os.path.join(assets_path, 'Lexi.ico')
    with open(ico_path, 'wb') as f:
        f.write(ico_bytes)
